import React from 'react'; 

function Step4() {
  return (
    <>
      <h1>Your Life Map</h1>
      <h2>Your Vision</h2>
      <p>{my_vision.vision}</p>
      <h2>Your Purpose</h2>
        <ol>
          <li>{my_purpose.reason1}</li>
          <li>{my_purpose.reason2}</li>
          <li>{my_purpose.reason3}</li>
        </ol>
      <h2>Your Values</h2>
      <h3>Print it out!</h3>
    </>
  );
}

export default Step4;
